import logo from './logo.svg';
import './App.css';
import {Button,ButtonContent,ButtonGroup,Icon} from 'semantic-ui-react'

function App() {
  return (
    <div className="button">
    <ButtonGroup>
      <Button animated>
        <ButtonContent visible>Shop</ButtonContent>
        <ButtonContent hidden><Icon name='shop'/></ButtonContent>
      </Button>
      <Button.Or/>
      <Button animated>
        <ButtonContent visible>Home</ButtonContent>
        <ButtonContent hidden>please</ButtonContent>
      </Button>
    </ButtonGroup>
    </div>
  );
}

export default App;
